pub fn pbrAttrSlot(attr_name: []const u8) ?usize {
    if (std.mem.eql(u8, attr_name, "pos")) {
        return 0;
    }
    if (std.mem.eql(u8, attr_name, "color0")) {
        return 1;
    }
    if (std.mem.eql(u8, attr_name, "texcoord0")) {
        return 2;
    }
    if (std.mem.eql(u8, attr_name, "normals")) {
        return 3;
    }
    if (std.mem.eql(u8, attr_name, "tangents")) {
        return 4;
    }
    return null;
}
pub fn pbrImageSlot(stage: sg.ShaderStage, img_name: []const u8) ?usize {
    if (sg.ShaderStage.FS == stage) {
        if (std.mem.eql(u8, img_name, "tex_irradiance")) {
            return 0;
        }
        if (std.mem.eql(u8, img_name, "tex_prefilter")) {
            return 1;
        }
        if (std.mem.eql(u8, img_name, "tex_brdf_lut")) {
            return 2;
        }
        if (std.mem.eql(u8, img_name, "tex")) {
            return 3;
        }
        if (std.mem.eql(u8, img_name, "tex_metallic_roughness")) {
            return 4;
        }
        if (std.mem.eql(u8, img_name, "tex_ao")) {
            return 5;
        }
    }
    return null;
}
pub fn pbrSamplerSlot(stage: sg.ShaderStage, smp_name: []const u8) ?usize {
    if (sg.ShaderStage.FS == stage) {
        if (std.mem.eql(u8, smp_name, "smp")) {
            return 0;
        }
    }
    return null;
}
pub fn pbrUniformblockSlot(stage: sg.ShaderStage, ub_name: []const u8) ?usize {
    if (sg.ShaderStage.VS == stage) {
        if (std.mem.eql(u8, ub_name, "vs_params")) {
            return 0;
        }
    }
    if (sg.ShaderStage.FS == stage) {
        if (std.mem.eql(u8, ub_name, "fs_params")) {
            return 0;
        }
    }
    return null;
}
pub fn pbrUniformblockSize(stage: sg.ShaderStage, ub_name: []const u8) ?usize {
    if (sg.ShaderStage.VS == stage) {
        if (std.mem.eql(u8, ub_name, "vs_params")) {
            return @sizeOf(VsParams);
        }
    }
    if (sg.ShaderStage.FS == stage) {
        if (std.mem.eql(u8, ub_name, "fs_params")) {
            return @sizeOf(FsParams);
        }
    }
    return null;
}
pub fn pbrUniformOffset(stage: sg.ShaderStage, ub_name: []const u8, u_name: []const u8) ?usize {
    if (sg.ShaderStage.VS == stage) {
        if (std.mem.eql(u8, ub_name, "vs_params")) {
            if (std.mem.eql(u8, u_name, "u_projViewMatrix")) {
                return 0;
